import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import './index.css';
import App from './components/App.js';
import Schedule from './components/ResultPage.js';
import Booking from './components/Customer.js';
import Vehicle from './components/Vehicles.js';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
    <Router>
        <div>
            <Route exact path="/" component={App}/>
            <Route exact path="/Results" component={Schedule}/>
            <Route exact path="/booking" component={Booking}/>
            <Route exact path="/vehicles" component={Vehicle}/>
        </div>
    </Router>,
     document.getElementById('root')
);


serviceWorker.unregister();
